import ItemDetailContainer from "./ItemDetailContainer";

const ItemListContainer = (props) => {
    return (
        <div class="home">
            <img alt="Imagen de inicio" src="./images/home.jpg" class="homeImage" />
            <h1>{props.greeting}</h1>
            <ItemDetailContainer/>
        </div>
    );
};

export default ItemListContainer;
